import React, { useState } from 'react';

const StateCreator = (props) => {


    let [creatorVisibility, setCreatorVisibility] = useState(false);

    let creatorStyle = {
        position: 'absolute',
        height: '100vh',
        border: '1px solid black',
        top: '0px',
        right: '0px',
        width: '20vw',
        backgroundColor: 'white',
    };

    let buttonStyle = {
        position: 'absolute',
        right: '0px'
    }

    const toggleCreator = () => {
        setCreatorVisibility(!creatorVisibility);
    }

    return (
        <div>
            creatorVisibility ? 
            <div style={creatorStyle}>
                <button onClick={toggleCreator}>X</button>
            </div>
            :
            <div style={buttonStyle}>
                <button onClick={toggleCreator}>New State</button>
            </div>
        </div>
    )
};

export default StateCreator;
